import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction';
import ListItemText from '@material-ui/core/ListItemText';
import IconButton from '@material-ui/core/IconButton';
import Grid from '@material-ui/core/Grid';
import EditIcon from '@material-ui/icons/Edit';

import Whiskas from '../../images/whiskas.jpg';
import Zeep from '../../images/zeep.jpg';
import Strokorrel from '../../images/strokorrel.png';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 752,
    marginLeft: '5ch',
    marginRight: '5ch'
  },
  demo: {
    backgroundColor: theme.palette.background.paper,
  },
  title: {
    margin: theme.spacing(4, 0, 2),
  },
  listitem: {
      marginBottom: '2ch',
  },
  listItemText:{
    paddingLeft: '2ch',
  }
}));

export default function InteractiveList() {
  const classes = useStyles();
  const [dense] = React.useState(false);

  return (
    <div className={classes.root}>
        <Grid item xs={12}>
          <div className={classes.demo}>
            <List dense={dense}>
                <ListItem className={classes.listitem}>
                  <ListItemAvatar >
                      <img src={Zeep} alt="not found" width="60" height="60"/>
                  </ListItemAvatar>
                  <ListItemText className={classes.listItemText}>
                      <Typography variant="h5">
                          Aloe Vera Zeep
                      </Typography>
                  </ListItemText>
                  <ListItemSecondaryAction>
                    <IconButton edge="end" aria-label="edit">
                      <EditIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
                <ListItem className={classes.listitem}>
                  <ListItemAvatar>
                    <img src={Strokorrel} alt="not found" width="60" height="60"/>
                  </ListItemAvatar>
                  <ListItemText className={classes.listItemText}>
                      <Typography variant="h5">
                          Strokorrel
                      </Typography>
                  </ListItemText>
                  <ListItemSecondaryAction>
                    <IconButton edge="end" aria-label="edit">
                      <EditIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
                <ListItem className={classes.listitem}>
                  <ListItemAvatar>
                    <img src={Whiskas} alt="not found" width="60" height="60"/>
                  </ListItemAvatar>
                  <ListItemText className={classes.listItemText}>
                      <Typography variant="h5">
                          Whiskas kattenvoer junior
                      </Typography>
                  </ListItemText>
                  <ListItemSecondaryAction>
                    <IconButton edge="end" aria-label="edit">
                      <EditIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
            </List>
          </div>
        </Grid>
    </div>
  );
}
